import React from 'react';

class Projects extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div class="tab-pane fade" id="prjects" role="tabpanel" aria-labelledby="projects-tab">
                <h2>Projects</h2>
            </div>
        )
    }
    
}

function Resume () {
    return <div>
        <h2>Resume</h2>
    </div>
}
export default Resume;
